import React from 'react';

const Profile = () => {
  return (
    <div className="container">
      <h1>User Profile</h1>
      <div className="card">
        <h3>Profile Information</h3>
        <p>Profile details will be displayed here</p>
      </div>
    </div>
  );
};

export default Profile;
